import { createStore } from 'redux'

function authenticated (state = false, action: any) {
  switch (action.type) {
    case 'LOGIN':
      return true
    case 'LOGOUT':
      return false
    default:
      return state
  }
}

const store = createStore(authenticated)

export default store
